import React, { Component } from 'react'
import home from '../../assests/home.svg'
export default class service_banner extends Component {
	render() {
		return (
			<div className='prd-service-section'>
				<div className='service-back'>
					<div className='container service-content'>
						<div className='back-image'>

						</div>
						<div className='back-txt'>
					 		<p><img src={home} alt='home-icon'/> <span>Services</span>Engineering <span>>Mobile apps development </span></p>
						</div>
					</div>
				</div>
			</div>
		)
	}
}
